INSERT INTO `t_chat_message` VALUES ('0c619b1b990fa8027e63d5a56fec0bf6', 'ef90f8d01f43e4534521ceb2479f9dba', 'assistant', 'c1decc47de9a2a7a8a4cb5b5ca810649', '以下是一个使用C++编写的快速排序算法：\n```c++\n#include <iostream>\n#include <vector>\nusing namespace std;\nvoid quickSort(vector<int>& arr) {\n    if (arr.size() <= 1)\n        return;\n    \n    int pivot = arr[0];\n    int left = 0;\n    int right = arr.size() - 1;\n    \n    while (left < right) {\n        while (left < right && arr[left] >= pivot)\n            left++;\n        \n        while (left < right && arr[right] >= pivot)\n            right--;\n        \n        if (left < right) {\n            arr[left] = arr[right];\n            ++right;\n        }\n    }\n    \n    quickSort(arr, left, pivot - 1);\n    quickSort(arr, pivot + 1, right);\n}\nint main() {\n    vector<int> arr = {10, 5, 8, 3, 7};\n    \n    quickSort(arr);\n    \n    cout << \"Sorted array: \" << endl;\n    for (int i = 0; i < arr.size(); i++)\n        cout << arr[i] << \" \";\n    cout << endl;\n    \n    return 0;\n}\n```', 0, 0, 0, NULL, NULL, '1970-01-02 00:00:00');
