INSERT INTO `t_chat_message` VALUES ('6994621e2f33aad8923dde11f13a5712', 'b2cbea9470f8e3521ca610fa4572c8e5', 'assistant', '9b0443fe1951c7aefc84aade0f93ee32', ' 以下是一个使用C++编写的快速排序算法：\n```c++\n#include <iostream>\n#include <vector>\nusing namespace std;\nvoid quickSort(vector<int>& arr) {\n    if (arr.size() <= 1)\n        return;\n    \n    int pivot = arr[0];\n    int left = 0;\n    int right = arr.size() - 1;\n    \n    while (left < right) {\n        while (left < right && arr[left] >= pivot)\n            left++;\n        \n        while (left < right && arr[right] >= pivot)\n            right--;\n        \n        if (left < right) {\n            arr[left] = arr[right];\n            ++right;\n        }\n    }\n    \n    quickSort(arr, left, pivot - 1);\n    quickSort(arr, pivot + 1, right);\n}\nint main() {\n    vector<int> arr = {10, 5, 8, 3, 7};\n    \n    quickSort(arr);\n    \n    cout << \"Sorted array: \" << endl;\n    for (int i = 0; i < arr.size(); i++)\n        cout << arr[i] << \" \";\n    cout << endl;\n    \n    return 0;\n}\n```\n\n', NULL, NULL, NULL, NULL, NULL, '2024-04-23 10:46:24');
