INSERT INTO `t_chat_message` VALUES ('ac832bc789da18552b53815571c003e9', 'f583f91de0689400fc6a6a0c56e2ca81', 'assistant', '36a10fe4f700de7f6504a7af4e257390', '以下是一个使用C++编写的快速排序算法：\n```c++\n#include <iostream>\n#include <vector>\nusing namespace std;\nvoid quickSort(vector<int>& arr) {\n    if (arr.size() <= 1)\n        return;\n    \n    int pivot = arr[0];\n    int left = 0;\n    int right = arr.size() - 1;\n    \n    while (left < right) {\n        while (left < right && arr[left] >= pivot)\n            left++;\n        \n        while (left < right && arr[right] >= pivot)\n            right--;\n        \n        if (left < right) {\n            arr[left] = arr[right];\n            ++right;\n        }\n    }\n    \n    quickSort(arr, left, pivot - 1);\n    quickSort(arr, pivot + 1, right);\n}\nint main() {\n    vector<int> arr = {10, 5, 8, 3, 7};\n    \n    quickSort(arr);\n    \n    cout << \"Sorted array: \" << endl;\n    for (int i = 0; i < arr.size(); i++)\n        cout << arr[i] << \" \";\n    cout << endl;\n    \n    return 0;\n}\n```', 0, 0, 0, NULL, NULL, '1970-01-02 00:00:00');
