INSERT INTO `t_chat_message` VALUES ('e0edb2dc1ba9dd839962f7cd3fe95d16', '275179a0d1ce78a04233bc21c3a04435', 'assistant', '8aff8b62e20b1a45b01ff31d5bb0a434', '好的，以下是一个使用Java编写快速排序算法的示例代码：\n```java\npublic class QuickSort {\n    public static void main(String[] args) {\n        int[] arr = {10, 5, 8, 3, 7};\n        quickSort(arr);\n        System.out.println(\"Sorted array: \" + Arrays.toString(arr));\n    }\n    \n    public static void quickSort(int[] arr) {\n        int left = 0;\n        int right = arr.length - 1;\n        \n        while (left <= right) {\n            while (left < right && arr[right] > arr[left])\n                right--;\n            \n            if (left < right)\n                swap(arr, left, right);\n            \n            left++;\n            right--;\n        }\n        \n        printArray(arr);\n    }\n    \n    public static void swap(int[] arr, int i, int j) {\n        int temp = arr[i];\n        arr[i] = arr[j];\n        arr[j] = temp;\n    }\n    \n    public static void swap(int[] array1, int i1, int j1) {\n        for (int k = 0; k < array1.length; k++)\n            if (k != i && k != j)\n                swapArray(array1, i++, j--);\n    }\n}\n```', 0, 0, 0, NULL, NULL, '1970-01-01 22:00:00');
